SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- =============================================
-- Author:		Artyom Valerevich M.
-- Create date: 02.06.2019
-- Description:	This procedure for create view 
--				of P.A.R.C. report
-- =============================================
CREATE PROCEDURE [dbo].[crtView] 
	-- Add the parameters for the stored procedure here
	@masterID int = null
AS
BEGIN
	-- =======================================================
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	-- =======================================================
	SET NOCOUNT ON;

    -- Insert statements for procedure here
	DROP TABLE IF EXISTS dbo.parcTable

	-- Declaration of variables that store field names and their values
	DECLARE @payApp INT, @acceptApp INT
	DECLARE	@readyApp INT, @closeApp INT
	DECLARE @pRow NVARCHAR(30), @aRow NVARCHAR(30)
	DECLARE @rRow NVARCHAR(30), @cRow NVARCHAR(30)

	-- Filling variables
	SET @pRow = 'Paid applications'
	SET @aRow = 'Accepted applications'
	SET @rRow = 'Ready applications'
	SET @cRow = 'Closed applications'
	SET @payApp = (SELECT COUNT(Payment) FROM Applications WHERE MasterID=@masterID AND Payment=1)
	SET @acceptApp = (SELECT COUNT(Acceptence) FROM Applications WHERE MasterID=@masterID AND Acceptence=1)
	SET @readyApp = (SELECT COUNT(Readiness) FROM Applications WHERE MasterID=@masterID AND Readiness=1)
	SET @closeApp = (SELECT COUNT(Closeness) FROM Applications WHERE MasterID=@masterID AND Closeness=1)

	-- Create temporary table to dislplay result
	CREATE TABLE dbo.parcView(
		[Sign of] NVARCHAR(30) NOT NULL,
		[Count] INT NOT NULL
	)

	-- Filling temporary table
	INSERT INTO dbo.parcView([Sign of],[Count]) VALUES (@pRow, @payApp)
	INSERT INTO dbo.parcView([Sign of],[Count]) VALUES (@aRow, @acceptApp)
	INSERT INTO dbo.parcView([Sign of],[Count]) VALUES (@rRow, @readyApp)
	INSERT INTO dbo.parcView([Sign of],[Count]) VALUES (@cRow, @closeApp)

	-- Display result
	SELECT * FROM dbo.parcView

	-- Delete temporary table
	DROP TABLE IF EXISTS dbo.parcView
END
GO
/****** Object:  Trigger [dbo].[OwnerBrandUpdate]    Script Date: 11.04.2020 20:11:07 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

create trigger [dbo].[OwnerBrandUpdate] on [dbo].[Cars]
	after insert, update
	as 
	declare @brID int, @owID int, @enID int
	declare @brand nvarchar(100), @owner nvarchar(100), @brandowner nvarchar(200)
	set @enID = (select id from inserted)
	set @brID = (select CarBrand from Cars where ID = @enID)
	set @owID = (select CarOwner from Cars where ID = @enID)
	set @brand = (select Manufacturers.Brand from Manufacturers where ID = @brID)
	set @owner = (select CarOwners.FullName from CarOwners where ID = @owID)
	set @brandowner = CONCAT(@brand,' | ',@owner)
	UPDATE Cars
	set BrandOwner = @brandowner where Cars.ID = @enID
GO
ALTER TABLE [dbo].[Cars] ENABLE TRIGGER [OwnerBrandUpdate]
GO
/****** Object:  Trigger [dbo].[ComputePassword1]    Script Date: 11.04.2020 20:11:07 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- =============================================
-- Author:		Artyom Valerevich M.
-- Create date: 03.06.2019
-- Description:	Computing password hash after
--	insert or update
-- =============================================
CREATE TRIGGER [dbo].[ComputePassword1] 
   ON  [dbo].[DATA] 
   INSTEAD OF UPDATE
AS 
BEGIN
	IF (@@ROWCOUNT = 0) RETURN;
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

    -- Insert statements for trigger here
	DECLARE @hash NVARCHAR(64);
	DECLARE @pass NVARCHAR(64);
	DECLARE @temp NVARCHAR(64);
	DECLARE @id INT;

	SET @temp = (SELECT [Password] FROM inserted);
	
	IF(LEN(@temp)<6) RETURN;

	SET @id = (SELECT [MasterID] FROM inserted);
	SET @pass = REPLACE(CONCAT(N'1t$_Am@31ng', @temp, N'y0UrL0g1'),CHAR(32),'');
	--SET @hash = TRIM(CONVERT(NVARCHAR(64), HASHBYTES('SHA2_256', @pass), 2));
	SET @hash = LTRIM(CONVERT(NVARCHAR(64), HASHBYTES('SHA2_256', @pass), 2));
	SET @hash = RTRIM(@hash);
	
	IF (UPDATE ([Password]))
	BEGIN
		UPDATE [dbo].[DATA]
		SET [DATA].[Password] = @hash,
		[DATA].[Login] = [inserted].[Login]
		FROM [inserted]
		WHERE [DATA].[MasterID] = [inserted].[MasterID];
	END
	ELSE
	BEGIN
		UPDATE [dbo].[DATA]
		SET [DATA].[Login] = [inserted].[Login]
		FROM [inserted]
		WHERE [DATA].[MasterID] = [inserted].[MasterID];
	END
END
GO
ALTER TABLE [dbo].[DATA] ENABLE TRIGGER [ComputePassword1]
GO
